import React from 'react';
import Tilt from 'react-tilt';
import racoon from './racoon.png';

const Logo = () => {
	return(
		<div className="ma4 mt0">
			<Tilt className="Tilt" options={{ max : 25 }} style={{ display: "flex", justifyContent: "center", height: 150, width: 150 }} >
				 <div className="Tilt-inner"> <img style={{display: "flex", justifyContent: "center"}} src={racoon} alt="img"/> </div>
			</Tilt>			
		</div>
	);
}

export default Logo;
